"use strict";function getList(){$.ajax({url:"../lib/json/nav.json",dataType:"json",success:function(s){console.log(s);var o="";s.forEach(function(n){o+="<li>".concat(n.name,"</li>")}),$(".nav ul").html(o).on({mouseenter:function(){$(".nav-box").stop().slideDown()},mouseleave:function(){return $(".nav-box").stop().slideUp()}}).children("li").on("mouseover",function(){var n=$(this).index(),o=s[n].list;console.log(o);var i="";o.forEach(function(n){i+='\n                        <li>\n                            <div>\n                                <img src="'.concat(n.list_url,'" alt="">\n                            </div>\n                            <p class="title">').concat(n.list_name,'</p>\n                            <span class="price">').concat(n.list_price,"</span>\n                        </li>")}),$(".nav-box ul").html(i)}),$(".nav-box").on({mouseover:function(){$(this).finish().show()},mouseout:function(){$(this).finish().slideUp()}})}})}getList();